import React from 'react' ;


const SavedCharacters = ({results}) => {
    let save;
    if(results){
        save = results.map((x) => {
            let { id, name, image, location, status } = x;

    return (
        <div>
            saved characters {save};
        </div>
        );
      });
    }
};

export default SavedCharacters;
